
var  LoadingSceneimg = "data:image/png;base64,";

var loadingBGimgbg = "data:image/png;base64,";

var loadingBarimg = "data:image/png;base64,";


LoadingScene = cc.Scene.extend({
    _interval : null,
    _label : null,
    _className:"LoadingScene",
    cb: null,
    target: null,

    ctor:function(){
        this._super();
        cc.log("LoadingScene  ctor");

         Winsize = cc.winSize;
    },
    /**
     * Contructor of cc.LoaderScene
     * @returns {boolean}
     */
    init : function(){
        cc.log("LoadingScene init")
        var self = this;
        //logo
        var logoWidth = 160;
        var logoHeight = 200;

        // bg
        var bgLayer = self._bgLayer = new cc.LayerColor(cc.color(32, 32, 32, 255));
        self.addChild(bgLayer, 0);

        //image move to CCSceneFile.js
        var fontSize = 34, lblHeight =  -logoHeight / 2 + 100;
        if(LoadingSceneimg){
            //loading logo
            cc.loader.loadImg(LoadingSceneimg, {isCrossOrigin : false }, function(err, img){
                logoWidth = img.width;
                logoHeight = img.height;
                self._initStage(img, cc.visibleRect.center);
            });
            fontSize = 34;
            lblHeight = -logoHeight / 2 - 10;
        }
        //loading percent
        var label = self._label = new cc.LabelTTF("正在加载资源... 0%", "Arial", fontSize);
        label.setPosition(cc.pAdd(cc.visibleRect.center, cc.p(0, lblHeight+30)));
        label.setColor(cc.color(223,119, 44));
        this.addChild(this._label, 99);

        //进度条


         if(loadingBGimgbg){
             cc.loader.loadImg(loadingBGimgbg,{isCrossOrigin : false},function(err,img){
                 var texture2dloadingBGimgbg =  new cc.Texture2D();
                 texture2dloadingBGimgbg.initWithElement(img);
                 texture2dloadingBGimgbg.handleLoadedTexture();
                 var  loadingBG = new cc.Sprite(texture2dloadingBGimgbg);
                 loadingBG.setPosition(cc.p(Winsize.width/2-579/2,570));
                 loadingBG.setAnchorPoint(0, 0.5);
                 self.addChild(loadingBG,99);
             })
         }

        if(loadingBarimg){
            cc.loader.loadImg(loadingBarimg,{isCrossOrigin : false},function(err,img){
                var texture2dloadingBarimg  = new cc.Texture2D();
                texture2dloadingBarimg.initWithElement(img);
                texture2dloadingBarimg.handleLoadedTexture();

                loadingBar = new cc.Sprite(texture2dloadingBarimg);
                loadingBar.setPosition(cc.p(Winsize.width/2-579/2 + 5,575));
                loadingBar.setAnchorPoint(0, 0.5);
                self.addChild(loadingBar,99);
                loadingBar.setScaleX(0.0001);
               // loadingBar.width = 10;


                //var loadingBar = new ccui.LoadingBar();
                //loadingBar.loadTexture(texture2dloadingBarimg);
                //loadingBar.setPercent(0);
                //loadingBar.setAnchorPoint(0,0.5);
                //loadingBar.setPosition(cc.p((Winsize.width-579)/2,575));
                //loadingBar.setPercent(50);
                //self.addChild(loadingBar,99);
            })
        }


        //var  loadingBG = new cc.Sprite("res/playRes/jindutiaobg.png");
        //loadingBG.setPosition(cc.p(Winsize.width/2-579/2,570));
        //loadingBG.setAnchorPoint(0, 0.5);
        //self.addChild(loadingBG,99);

        //loadingBar = new ccui.LoadingBar();
        //loadingBar.loadTexture("res/playRes/jindutiao.png");
        //loadingBar.setPercent(0);
        //loadingBar.setAnchorPoint(0,0.5);
        //loadingBar.setPosition(cc.p((Winsize.width-579)/2,575));
        //this.addChild(loadingBar,99);

        //loadingBar.setPercent(50);


        return true;
    },

    _initStage: function (img, centerPos) {
        var self = this;
        var texture2d = self._texture2d = new cc.Texture2D();
        texture2d.initWithElement(img);
        texture2d.handleLoadedTexture();
        var logo = self._logo = new cc.Sprite(texture2d);
        logo.setScale(cc.contentScaleFactor());
        logo.setScale(1.4)
        logo.x = Winsize.width/2
        logo.y = Winsize.height/2+150
        this.addChild(logo, 10);
    },
    /**
     * custom onEnter
     */
    onEnter: function () {
        var self = this;
        cc.Node.prototype.onEnter.call(self);
        self.schedule(self._startLoading, 0.3);

    },
    /**
     * custom onExit
     */
    onExit: function () {
        cc.Node.prototype.onExit.call(this);
        var tmpStr = "正在加载资源... 0%";
        this._label.setString(tmpStr);
    },

    /**
     * init with resources
     * @param {Array} resources
     * @param {Function|String} cb
     * @param {Object} target
     */
    initWithResources: function (resources, cb, target) {
        if(cc.isString(resources))
            resources = [resources];
        this.resources = resources || [];
        this.cb = cb;
        this.target = target;
    },

    _startLoading: function () {
        var self = this;
        self.unschedule(self._startLoading);
        var res = self.resources;
        cc.loader.load(res,
            function (result, count, loadedCount) {
                var percent = (loadedCount / count * 100) | 0;
                percent = Math.min(percent, 100);
                self._label.setString("正在加载资源... " + percent + "%");
                loadingBar.setScaleX(percent/100);
            }, function () {
                if (self.cb)
                    self.cb.call(self.target);
            });
    },

    _updateTransform: function(){
        this._renderCmd.setDirtyFlag(cc.Node._dirtyFlags.transformDirty);
        this._bgLayer._renderCmd.setDirtyFlag(cc.Node._dirtyFlags.transformDirty);
        this._label._renderCmd.setDirtyFlag(cc.Node._dirtyFlags.transformDirty);
        this._logo._renderCmd.setDirtyFlag(cc.Node._dirtyFlags.transformDirty);
    }
});
/**
 * <p>cc.LoaderScene.preload can present a loaderScene with download progress.</p>
 * <p>when all the resource are downloaded it will invoke call function</p>
 * @param resources
 * @param cb
 * @param target
 * @returns {cc.LoaderScene|*}
 * @example
 * //Example
 * cc.LoaderScene.preload(g_resources, function () {
        cc.director.runScene(new HelloWorldScene());
    }, this);
 */
LoadingScene.preload = function(resources, cb, target){
    var _cc = cc;
    if(!_cc.loaderScene) {
        _cc.loaderScene = new LoadingScene();
        _cc.loaderScene.init();
        cc.eventManager.addCustomListener(cc.Director.EVENT_PROJECTION_CHANGED, function(){
            _cc.loaderScene._updateTransform();
        });
    }
    _cc.loaderScene.initWithResources(resources, cb, target);

    cc.director.runScene(_cc.loaderScene);
    return _cc.loaderScene;
};